import React, { Component } from 'react';

class Navbar extends Component {
    state = {  }
    render() { 
        return ( 
            <div>
                <nav class = "navbar navbar-expand-md navbar-dark bg-dark">

                    <span class = "navbar-text ">Task List</span>

                    <ul class = "navbar-nav">
                        <li class = "nav-item">
                            <a class = "nav-link" href = "button">Link 1</a>
                        </li>
                        <li class = "nav-item">
                            <a class = "nav-link" href = "button">Link 2</a>
                        </li>
                        <li class = "nav-item">
                            <a class = "nav-link" href = "button">Link 3</a>
                        </li>
                        <li class = "nav-item">
                            <a class = "nav-link" href = "button">Link 4</a>
                        </li>
                    </ul>
                </nav>
            </div>
         );
    }
}

export default Navbar;
